// src/App.js

import React from 'react';
import './App.css'; // sau alte stiluri globale

import Login from './Login';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My App</h1>
      </header>
      <main>
        <Login />
      </main>
    </div>
  );
}

export default App;
